DROP TABLE IF EXISTS `order_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `order_product` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` bigint(20) DEFAULT NULL,
  `product_name` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `quantity` int(11) DEFAULT '0' COMMENT '数量',
  `price` double DEFAULT '0' COMMENT '单个商品价格\n',
  `order_id` bigint(20) unsigned DEFAULT '0' COMMENT '订单id',
  `gmt_create` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '产品id',
  PRIMARY KEY (`id`),
  KEY `ORDER_KEY_idx` (`order_id`),
  CONSTRAINT `ORDER_KEY` FOREIGN KEY (`order_id`) REFERENCES `order_record` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8 COMMENT='订单关联的产品表';
